{'action': 'created', 'issue': {'url': 'https://api.github.com/repos/stanfordnlp/dspy/issues/704', 'repository_url': 'https://api.github.com/repos/stanfordnlp/dspy', 'labels_url': 'https://api.github.com/repos/stanfordnlp/dspy/issues/704/labels{/name}', 'comments_url': 'https://api.github.com/repos/stanfordnlp/dspy/issues/704/comments', 'events_url': 'https://api.github.com/repos/stanfordnlp/dspy/issues/704/events', 'html_url': 'https://github.com/stanfordnlp/dspy/pull/704', 'id': 2204079244, 'node_id': 'PR_kwDOIv2ufM5qkjgI', 'number': 704, 'title': 'Add dev container support for project', 'user': {'login': 'Joshmantova', 'id': 54721268, 'node_id': 'MDQ6VXNlcjU0NzIxMjY4', 'avatar_url': 'https://avatars.githubusercontent.com/u/54721268?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/Joshmantova', 'html_url': 'https://github.com/Joshmantova', 'followers_url': 'https://api.github.com/users/Joshmantova/followers', 'following_url': 'https://api.github.com/users/Joshmantova/following{/other_user}', 'gists_url': 'https://api.github.com/users/Joshmantova/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/Joshmantova/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/Joshmantova/subscriptions', 'organizations_url': 'https://api.github.com/users/Joshmantova/orgs', 'repos_url': 'https://api.github.com/users/Joshmantova/repos', 'events_url': 'https://api.github.com/users/Joshmantova/events{/privacy}', 'received_events_url': 'https://api.github.com/users/Joshmantova/received_events', 'type': 'User', 'site_admin': False}, 'labels': [], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 5, 'created_at': '2024-03-23T22:47:29Z', 'updated_at': '2024-03-28T01:40:02Z', 'closed_at': None, 'author_association': 'CONTRIBUTOR', 'active_lock_reason': None, 'draft': False, 'pull_request': {'url': 'https://api.github.com/repos/stanfordnlp/dspy/pulls/704', 'html_url': 'https://github.com/stanfordnlp/dspy/pull/704', 'diff_url': 'https://github.com/stanfordnlp/dspy/pull/704.diff', 'patch_url': 'https://github.com/stanfordnlp/dspy/pull/704.patch', 'merged_at': None}, 'body': "Currently, there's a contributor.md file that looks to be out of date. I think it's confusing for new contributors to join and meaningfully contribute to the project because getting set up is somewhat complicated. This introduces a VSCode dev container solution for all developers to share a dev environment including proper linting, requirements, and extensions. I think this will make it easier for additional contributors to join without friction and improve the project. Let me know if there are any other customizations you'd want developers to be set up with for this project. Because this repo is on github, this will also allows anyone to develop from the web browser using Github codespaces and still have a proper dev environment set up.", 'reactions': {'url': 'https://api.github.com/repos/stanfordnlp/dspy/issues/704/reactions', 'total_count': 1, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 1, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/stanfordnlp/dspy/issues/704/timeline', 'performed_via_github_app': None, 'state_reason': None}, 'comment': {'url': 'https://api.github.com/repos/stanfordnlp/dspy/issues/comments/2024247178', 'html_url': 'https://github.com/stanfordnlp/dspy/pull/704#issuecomment-2024247178', 'issue_url': 'https://api.github.com/repos/stanfordnlp/dspy/issues/704', 'id': 2024247178, 'node_id': 'IC_kwDOIv2ufM54p4-K', 'user': {'login': 'josh-mantovani', 'id': 103706679, 'node_id': 'U_kgDOBi5wNw', 'avatar_url': 'https://avatars.githubusercontent.com/u/103706679?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/josh-mantovani', 'html_url': 'https://github.com/josh-mantovani', 'followers_url': 'https://api.github.com/users/josh-mantovani/followers', 'following_url': 'https://api.github.com/users/josh-mantovani/following{/other_user}', 'gists_url': 'https://api.github.com/users/josh-mantovani/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/josh-mantovani/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/josh-mantovani/subscriptions', 'organizations_url': 'https://api.github.com/users/josh-mantovani/orgs', 'repos_url': 'https://api.github.com/users/josh-mantovani/repos', 'events_url': 'https://api.github.com/users/josh-mantovani/events{/privacy}', 'received_events_url': 'https://api.github.com/users/josh-mantovani/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2024-03-28T01:40:00Z', 'updated_at': '2024-03-28T01:40:00Z', 'author_association': 'NONE', 'body': "> This looks great! Thanks for doing this work.
